import createReactComponent from "../createReactComponent";
import defaultAttributes from "../defaultAttributes";
var ArrowLeftCircle = createReactComponent("ArrowLeftCircle", ["svg", defaultAttributes, [["circle", {
  cx: "12",
  cy: "12",
  r: "10",
  key: "14id60"
}], ["polyline", {
  points: "12 8 8 12 12 16",
  key: "xj9ozb"
}], ["line", {
  x1: "16",
  y1: "12",
  x2: "8",
  y2: "12",
  key: "nlup73"
}]]]);
export default ArrowLeftCircle;
